<script src="https://telegram.org/js/telegram-web-app.js"></script>
<script>
    let tg = window.Telegram.WebApp;
    const button = document.querySelector('.button_menu');
    const button_connect = document.querySelector('.connect');
    const button_buy = document.querySelector('.buy');
    const button_downwload = document.querySelector('.downwload');
    const battery = document.querySelector('.battery');
    const text_help = document.querySelector('.text-help');
    const modal_server = document.querySelector('.server-window');
    const server_bt_back = document.querySelector('.server_bt_back');


    function serverBackMenu() {
        button.style.display = 'flex';
        battery.style.visibility = 'visible';
        text_help.style.visibility = 'visible';
        modal_server.style.display = 'none';
    }
    function getServerMenu() {
        button.style.display = 'none';
        battery.style.visibility = 'hidden';
        text_help.style.visibility = 'hidden';
        modal_server.style.display = 'flex';
    }

    button_connect.addEventListener('click', getServerMenu);
    server_bt_back.addEventListener('click', serverBackMenu);

    const serverButtons = document.querySelectorAll('.server-button');

    // Добавляем обработчик клика для каждой кнопки сервера
    serverButtons.forEach(button => {
        button.addEventListener('click', function() {
            // Убираем класс selected у всех кнопок
            serverButtons.forEach(btn => {
                btn.classList.remove('selected');
            });
            
            // Добавляем класс selected только для кликнутой кнопки
            this.classList.add('selected');
        });
    });
    


    // Добавляем обработчик события click
    button_downwload.addEventListener('click', function() {
        // Перенаправляем пользователя на заданную ссылку при клике на кнопку
        window.location.href = 'https://apps.apple.com/app/id6450534064'; // Замените ссылкой на нужную
    });

    
</script>
